                <Container>
                    <Navbar.Brand href="#home">
                        <img
                            alt=""
                            src="/src/styles/logotip.svg"
                            width={30}
                            height={30}
                            className="d-inline-block align-top"
                        />{' '}
                        НИИ Радио
                    </Navbar.Brand>
                </Container>
            </Navbar>
            <br/>
        </>
    );
}

export default Header;
